import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Nav, Tab } from "react-bootstrap";
import Header from "../layout/header";
import Footer from "../layout/footer";
import Brand1 from "../element/brand1";
import axios from "axios";

const aboutbg = require("./../../assets/images/background/image-11.jpg");
const touchbg = require("./../../assets/images/background/image-8.jpg");

class CreateCase extends Component {
  state = {
    name_1: "",
    email_1: "",
    message: "",
  };

  componentDidMount() {
    axios.get(`http://localhost:4000/case`).then((res) => {
      console.log(res.data);
    });
  }

  render() {
    return (
      <>
        <Header />
        {/* <!-- Page Banner Section --> */}
        <section class="page-banner">
          <div
            className="page-banner-bg"
            style={{ backgroundImage: "url(" + aboutbg + ")" }}
          ></div>
          <div class="bottom-rotten-curve alternate"></div>

          <div class="auto-container">
            <h1>Cases</h1>
            <ul class="bread-crumb clearfix">
              <li>
                <Link to={"/#"}>Home</Link>
              </li>
              <li class="active">Cases</li>
            </ul>
          </div>
        </section>
        {/* <!--End Banner Section --> */}
        {/* <!-- Services Section Two --> */}
        <section class="services-section-two services-section-careers">
          <div class="auto-container">
            <div class="wrapper-box">
              <div
                style={{
                  backgroundImage: "url(" + touchbg + ")",
                  margin: "auto",
                }}
              >
                <div class="sec-title light">
                  <div class="sub-title">Get In Touch</div>
                  <h2>
                    Get Us Here Or <br /> Share Details
                  </h2>
                </div>
                {/* <!-- Contact Form--> */}
                <div class="contact-form">
                  <div class="row clearfix">
                    <div class="col-md-12 form-group">
                      <input
                        type="text"
                        name="username"
                        placeholder="Enter name here......"
                        required=""
                        onChange={(e) => {
                          this.setState({ name_1: e.target.value });
                          console.log(this.state);
                        }}
                      />
                      <i class="fas fa-user"></i>
                    </div>

                    <div class="col-md-12 form-group">
                      <input
                        type="email"
                        name="email"
                        placeholder="Enter email here......"
                        required=""
                        onChange={(e) => {
                          this.setState({ email_1: e.target.value });
                          console.log(this.state);
                        }}
                      />
                      <i class="fas fa-envelope"></i>
                    </div>

                    <div class="col-md-12 form-group">
                      <textarea
                        name="message"
                        placeholder="Enter message here......"
                      ></textarea>
                      <i class="fas fa-edit"></i>
                    </div>

                    <div class="col-md-12 form-group">
                      <button
                        class="theme-btn btn-style-one"
                        type="submit"
                        name="submit-form"
                      >
                        <span class="btn-title">Get In Touch</span>
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </>
    );
  }
}
export default CreateCase;
